SELECT a.name
FROM author a
WHERE a.oid IS NULL;

SELECT title
FROM publication
ORDER BY title;

SELECT COUNT(*)
FROM student
WHERE predicted_graduation_semester >= date('now', '-10 years');

SELECT AVG(EXTRACT(EPOCH
                   FROM predicted_graduation_semester - admit_term)) AS average_days_to_graduation
FROM student;

SELECT name
FROM course
WHERE department = 'Computer Science';

SELECT AVG(EXTRACT(MINUTE
                   FROM (to_timestamp('arrival_time', 'unixepoch') - to_timestamp('departure_time', 'unixepoch')) - INTERVAL '34 minutes')) AS average_duration_minutes
FROM flight;

SELECT MIN(minimum_connect_time)
FROM airport
WHERE airport_code = 'JFK';

SELECT city.state_code
FROM city
WHERE city.city_name = 'Orlando';

SELECT a.aircraft_code,
       (a.capacity / a.range_miles) AS capacity_to_range_ratio
FROM aircraft a;

SELECT fare_id,
       ROUND((one_direction_cost / round_trip_cost) * 100, 2) AS "One-Way Cost Ratio"
FROM fare;

SELECT river_name
FROM river
WHERE traverse LIKE '% , % , %' -- Check if 'traverse' contains at least three commas, indicating three or more cities.;

SELECT state_name
FROM state
WHERE population < 100000;

SELECT state_name,
       population / area AS population_density
FROM state;

SELECT name
FROM restaurant
WHERE food_type = 'Italian';

SELECT *
FROM restaurant
ORDER BY rating DESC;

SELECT (COUNT(id) FILTER (
                          WHERE rating > 4.5))::decimal / COUNT(*) AS ratio_high_rated_restaurants
FROM restaurant;

SELECT journalname
FROM journal
ORDER BY LENGTH(journalname);

SELECT CAST(COUNT(DISTINCT paperid) AS NUMERIC) FILTER (
                                                        WHERE YEAR = 2020) / COUNT(DISTINCT paperid) * 100 AS ratio
FROM paper;

SELECT AVG(rating) AS average_rating
FROM review
WHERE business.city = 'San Francisco';

SELECT name
FROM business
ORDER BY name;
